import React from "react";
import { Route, Switch } from "react-router-dom";
import Login from "./login/Login";
import Popup from "./Popup"

function Routes() {
    return(
        <switch>
            <Route exact path="/extension/popup">
                <Popup/>
            </Route>
            <Route exact path="/">
                <Login/>
            </Route>
        </switch>
    )
}

export default Routes;
